import React from 'react';

function Skills() {
  return (
    <section className="skills">
      <h2>Skills</h2>
      <ul>
        <li>Skill 1</li>
        <li>Skill 2</li>
        <li>Skill 3</li>
        {/* Add more skills here */}
      </ul>
    </section>
  );
}

export default Skills;
